import React from 'react';
import './Header.css';

export default () => {
    return(
            <header>
                <div className="header--logo">
                    <a href="/">
                        <img src="https://pt.wikipedia.org/wiki/Netflix#/media/Ficheiro:Netflix_2015_logo.svg"/>
                    </a>
                </div>
            </header>
    );
}
